class Solution {
public:
    vector<int> largestMultipleOfThree(vector<int>& nums) {
        set<int> s(nums.begin(), nums.end());
        vector<int> res;
        for(int i = *s.begin(); s.find(i) != s.end(); i = *(--s.upper_bound(i)))
            res.push_back(i);
        return res;
    }
};

